      "excerpt": "<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<p>并发是编程里比较重要的概念。Go语言在语言层面上天生支持并发，这也是 Go 语言流行的重要原因</p>\n</div>\n<h2 id=\"进程和线程\"><a class=\"header-anchor\" href=\"#进程和线程\">#</a> 进程和线程</h2>\n<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<p>进程是计算机中资源分配的最小单元(相当于一个车间),一个进程中可以有多个线程(车间里的员工),同一个进程中的线程共享进程中的资源。（车间里的员工可以使用该车间的共享资源）。</p>\n</div>\n<div class=\"custom-block danger\"><p class=\"custom-block-title\">警告</p>\n<p><strong>注意：进程与进程之间是相互隔离的，每个进程中都维护自己独立的数据，不进行共享；如果想让他们之间进行共享，需要借助一些特殊的办法去实现</strong></p>\n</div>\n",
